import React, { useState } from 'react';
import './App.css';

interface Entry {
  name: string;
  number: string;
  email: string;
  amountToPay: string;
  amountPaid: string;
}

function App() {
  const [form, setForm] = useState<Entry>({
    name: '',
    number: '',
    email: '',
    amountToPay: '',
    amountPaid: '',
  });
  const [entries, setEntries] = useState<Entry[]>([]);

  const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    setEntries([...entries, form]);
    setForm({ name: '', number: '', email: '', amountToPay: '', amountPaid: '' });
  };

  return (
    <div className="dashboard-container">
      <h1>Duedesk Dashboard</h1>
      <form className="entry-form" onSubmit={handleSubmit}>
        <input
          type="text"
          name="name"
          placeholder="Name"
          value={form.name}
          onChange={handleChange}
          required
        />
        <input
          type="text"
          name="number"
          placeholder="Number"
          value={form.number}
          onChange={handleChange}
          required
        />
        <input
          type="email"
          name="email"
          placeholder="Email"
          value={form.email}
          onChange={handleChange}
          required
        />
        <input
          type="number"
          name="amountToPay"
          placeholder="Amount to Pay"
          value={form.amountToPay}
          onChange={handleChange}
          required
        />
        <input
          type="number"
          name="amountPaid"
          placeholder="Amount Paid"
          value={form.amountPaid}
          onChange={handleChange}
          required
        />
        <button type="submit">Add Entry</button>
      </form>
      <div className="table-container">
        <table>
          <thead>
            <tr>
              <th>Name</th>
              <th>Number</th>
              <th>Email</th>
              <th>Amount to Pay</th>
              <th>Amount Paid</th>
            </tr>
          </thead>
          <tbody>
            {entries.map((entry, idx) => (
              <tr key={idx}>
                <td>{entry.name}</td>
                <td>{entry.number}</td>
                <td>{entry.email}</td>
                <td>{entry.amountToPay}</td>
                <td>{entry.amountPaid}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default App;
